import "./style.css";
import Cwhite from "./chessWhite";
const Chess =()=>
{
    return(
        <div className= "chess">
            <div className="container black_box"></div>
            <div className="container black_box"></div>
            <div className="container black_box"></div>
            <div className="container black_box"></div>
            <Cwhite />
        </div>
    );
}

export default Chess;
